import galeria from './galeria'
import  './gallery.scss';


function Gallery() {

    return(

        <div id="galeria">
            <h1>Portifolio</h1>
           {galerias.map((galeria)=>
           <>
           <div class ="itens">
            <img key = {galeria.i}src={galeria.imagem} alt={galeria.nome} /> 
            <h3 >{galeria.nome}</h3>
            <a href={galeria.github} target="_blank" rel="noreferrer">GitPage</a>
            <a href={galeria.repositorio} target="_blank" rel="noreferrer">GitHub</a>  
           </div>           
           </>)}
        </div>
    )
}

export default Gallery;
